import React from 'react';
import './App.css';
import {Route,Switch,Link} from 'react-router-dom';
import Home from './components/Home';
import CollectClinicals from './components/CollectClinicals';
import AddPatient from './components/AddPatient';
import AnalyzeData from './components/AnalyzeData';
import ChartGenerator from './components/ChartGenerator';
import 'bootstrap/dist/css/bootstrap.min.css';
import Login from "./components/login.component";
import Register from "./components/register.component";
import { Component } from 'react';
import AuthService from "./services/auth.service";
import Profile from "./components/profile.component";
import { Button, Container, Row, Col, Alert, Table, Navbar, Nav, NavDropdown, Carousel } from 'react-bootstrap';
import './css/Home.css'
import image from './assets/iamges/61808.jpg'
import slika from './assets/iamges/slika.jpg'
import slika1 from './assets/iamges/cveke.jpg'
class App extends Component {

  constructor(props) {

    super(props);
    this.logOut = this.logOut.bind(this);

    this.state = {
      showDoctorBoard: false,
      showAdminBoard: false,
      currentUser: undefined,
    };
  }

  componentDidMount() {
    const user = AuthService.getCurrentUser();

    if (user) {
      this.setState({
        currentUser: user,
        showDoctorBoard: user.roles.includes("ROLE_DOCTOR"),
        showAdminBoard: user.roles.includes("ROLE_ADMIN"),
      });
    }
  }

  logOut() {
    AuthService.logout();
  }



  render() {
    const { currentUser, showDoctorBoard, showAdminBoard } = this.state;
    return (
      <div className='Login-component'>


              <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
        <Navbar.Brand className="mx-5" href="/" style={{ color: '#5bc0de'}} >Neno's Clinic</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">

          {currentUser && (
            <Nav>
            <Nav.Link className="mx-1" href="/" style={{ color: '#5bc0de'}}>Home</Nav.Link>
            </Nav>
          )}

          {currentUser ?(
            <Nav>
            <Nav.Link className="mx-5" href="/login" onClick={this.logOut} style={{ color: '#5bc0de'}}>LogOut</Nav.Link>
            </Nav>
          ) : (

          <Nav>
          <Nav.Link className="mx-1" href="/register" style={{ color: '#5bc0de'}}>Sign Up</Nav.Link>
          <Nav.Link className="mx-5" href="/login" style={{ color: '#5bc0de'}}>Login</Nav.Link>
          </Nav>

          )}
        </Navbar.Collapse>
        </Navbar>

        <div className="app">
          <Switch>
          <Route exact path="/home" component={Home}/>
        <Route exact path="/login" component={Login}/>
        <Route exact path="/register" component={Register}/>
        <Route exact path="/patientDetails/:patientId" component={CollectClinicals}/>
        <Route exact path="/profile" component={Profile} />
        <Route exact path="/addPatient" component={AddPatient}/>
        <Route exact path="/analyze/:patientId" component={AnalyzeData}/>
        <Route exact path="/chart/:componentName/:patientId" component={ChartGenerator}/>
          </Switch>
        </div>
    </div>
    );
  }
}
export default App;
